def normalize_dist(d,d2,rev=False):
    # input diag matrix 
    d = np.array(d)
    for i in range(d.shape[0]):
        for j in range(d.shape[1]):
            if i!=j:
                for z in range(d.shape[2]):
                    d1 = d2[i,i]  +  d2[j,j] 
                    m = d1/2
                    if rev:
                        m = 2/d1
                    d[i,j,z] =  d[i,j,z]*m  # or the other way araound
    return d


